import axios from 'axios';
const getData = async() =>{
    try {
        const res = await axios.get("/api/products")
        const data = res.data.products;
        console.log("data aaya hai", data);
        return data;
    } catch (error) {
        console.log("product nhi aara : ", error);
    }
}

const postWishlist = async(data) =>{
    try {
        const res = await axios.post("/api/wishlist", data)
        const wishlist = res.data.wishlist;
        console.log("wishlist aaya hai", wishlist);
        return wishlist;
    } catch (error) {
        console.log("wishlist nhi aara : ", error);
    }
}

const deleteWishlist = async(data) =>{
    try {
        const res = await axios.delete("/api/wishlist", data)
        const wishlist = res.data.wishlist;
        console.log("wishlist aaya hai", wishlist);
        return wishlist;
    } catch (error) {
        console.log("wishlist nhi aara : ", error);
    }
}

export {getData};
